import "./header.css"


export default function Header() {
    return (
        <div className="header">
          <div className="headerTitles">
              <span className="headerTitleSm">SWOLE</span>
              <span className="headerTitleLg">SPACE</span>

          </div>
          <img className="headerImage" src="./header.png"/>
        </div>
    )
}
